--
-- Triggers `vouchers`
--
DELIMITER //
CREATE TRIGGER `TR_VOUCHER_BEFORE_INS` BEFORE INSERT ON `vouchers`
 FOR EACH ROW BEGIN

if (NEW.VCH_TYPE>0) then

	set @vchno = (SELECT max(VCH_NO) FROM vouchers 
                  where VCH_TYPE= NEW.VCH_TYPE 
                  and VCH_YEAR=NEW.VCH_YEAR 
                  and VCH_MONTH=NEW.VCH_MONTH) + 1;
    
    set @vchno= IFNULL(@vchno ,1);
    set @vmonth=LPAD(NEW.VCH_MONTH,2,'0');
    set @vtype=LPAD(NEW.VCH_TYPE,2,'0');

	set @vc=LPAD(@vchno,5,'0');
	set @vchno_full=CONCAT(@vtype,NEW.VCH_YEAR,@vmonth, @vc);


	set NEW.VCH_NO=@vchno,NEW.VCH_NO_FULL=@vchno_full;

	
else
	
     signal sqlstate '45000' set message_text = 'Error occur while inserting';
	
end if;
end
//
DELIMITER ;

